import React from 'react';


import { Container } from './styles';


export default function Order() {

  return (
    <Container>
      <hr/>
      <br/>
      <p>As we continue to monitor the situation with Coronavirus (COVID-19), we are taking steps to help protect the health and well-being of our customers and partners. Learn more</p>
      <br/>
      <hr/>
    </Container>
  );
}
